INSERT INTO `sys_dict` VALUES ('BACK_CHANGE_RULE', '退改规则', '<p style=\"white-space: normal\"><span style=\"font-size: 20px;color: rgb(255, 0, 0)\"><strong>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;订单退改规则</strong></span></p><p style=\"white-space: normal\">1&nbsp;<span style=\"font-family: 宋体\">为不影响您和其他会员的既定行程，在您修改订单起止时间时，请在原取车、还车时间点提前至少</span>2<span style=\"font-family: 宋体\">个工作小时提交修改。</span></p><p style=\"white-space: normal\">2&nbsp;<span style=\"font-family: 宋体\">距离预订取车时间不足</span>2<span style=\"font-family: 宋体\">个工作小时的订单，不能修改取车时间。距离预订还车车时间不足</span>2<span style=\"font-family: 宋体\">个工作小时的订单，不能修改还车时间。</span></p><p style=\"white-space: normal\">3&nbsp;<span style=\"font-family: 宋体\">修改订单取还车方式（如送车上门），请您在原取还车时间点提前至少</span>4<span style=\"font-family: 宋体\">个工作小时修改。</span></p><p style=\"white-space: normal\">4&nbsp;<span style=\"font-family: 宋体\">取消订单需提前一天在智行家</span>APP<span style=\"font-family: 宋体\">中进行。订单计划取车时间当天，订单不能在</span>APP<span style=\"font-family: 宋体\">中取消。如必须取消</span>,&nbsp;<span style=\"font-family: 宋体\">请联系客服处理。由客服取消的订单，其预付款中的基本保险、可选服务费将退还给您，但将扣除手续费和一天车辆租赁费将作为违约金。</span></p><p style=\"white-space: normal\">5&nbsp;<span style=\"font-family: 宋体\">提前还车申请成功后，如果租赁天数少于原有天数，将退还多余的租金和服务费。</span></p><p style=\"white-space: normal\">6&nbsp;<span style=\"font-family: 宋体\">您对订单的修改将影响到您的预订价格，请您慎重。</span></p><p style=\"white-space: normal\">7&nbsp;<span style=\"font-family: 宋体\">由于距马科技租车原因导致订单取消的，我们除退还您已付金额外，还将补偿您已付金额等值的代金券。</span></p><p style=\"white-space: normal\">8&nbsp;<span style=\"font-family: 宋体\">若行程已经开始，双方无正当理由，无权再取消订单。</span></p><p style=\"white-space: normal\"><br/></p><p style=\"white-space: normal\">9&nbsp;<span style=\"font-family: 宋体\">在没有征得距马科技同意，超出约定范围驾驶车辆，或者延长车辆使用时间，则我方有权中途取消订单而不需支付违约金。</span></p><p style=\"white-space: normal\"><span style=\"font-family: 宋体\">10 租期超过30天的订单退改,请联系客服。</span></p><p><br/></p>', '1', 'BACK_CHANGE', '退改规则', '11', '0', '2016-08-22 14:47:04', '2016-09-12 10:12:04');
