INSERT INTO `sys_dict` VALUES ('REGISTER_AGREEMENT', '注册协议', '<p class=\"MsoNormal\" style=\"text-align:center;\"><strong><span lang=\"ZH-CN\" style=\"font-size:14.0pt;font-family:宋体;mso-ascii-font-family:\nCalibri;mso-hansi-font-family:Calibri;color:#4F81BD\">距马</span></strong><strong><span style=\"font-size:14.0pt;color:#4F81BD\">(</span></strong><strong><span lang=\"ZH-CN\" style=\"font-size:14.0pt;\nfont-family:宋体;mso-ascii-font-family:Calibri;mso-hansi-font-family:Calibri;\ncolor:#4F81BD\">上海</span></strong><strong><span style=\"font-size:14.0pt;color:#4F81BD\">)</span></strong><strong><span lang=\"ZH-CN\" style=\"font-size:14.0pt;font-family:宋体;mso-ascii-font-family:\nCalibri;mso-hansi-font-family:Calibri;color:#4F81BD\">科技有限公司服务协议</span></strong><strong><span style=\"font-size:14.0pt;color:#4F81BD\"><o:p></o:p></span></strong></p><p class=\"MsoNormal\" style=\"text-align:left;\"><o:p>&nbsp;</o:p></p><p class=\"MsoNormal\" style=\"text-align:left;text-indent: 21pt;\"><span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:Calibri;mso-hansi-font-family:\nCalibri\">距马</span>(<span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:\nCalibri;mso-hansi-font-family:Calibri\">上海</span>)<span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:Calibri;mso-hansi-font-family:Calibri\">科技有限公司所提供的各项服务和内容的所有权和运作权均归距马</span>(<span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:Calibri;mso-hansi-font-family:\nCalibri\">上海</span>)<span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:\nCalibri;mso-hansi-font-family:Calibri\">科技有限公司及其关联公司（以下简称“距马科技”）所有。您确认，在您注册成为距马科技会员</span>,<span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:Calibri;\nmso-hansi-font-family:Calibri\">并在本网站、微信公众号、距马科技关联公司网站或其他距马科技提供的移动应用或软件</span>( <span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:Calibri;mso-hansi-font-family:\nCalibri\">包括但不限于</span>”<span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:\nCalibri;mso-hansi-font-family:Calibri\">智行家</span>”<span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:Calibri;mso-hansi-font-family:Calibri\">，以下简称“距马科技服务平台”）上访问、预定或使用我们的产品或服务（以上统称为“服务”）之前，您已充分阅读、理解并接受本条款全部内容，一旦您使用距马科技服务，即表示您同意遵循本条款之所有约定。若您不同意以下任何条款内容，您应立即停止使用本服务。</span><o:p></o:p></p><p class=\"MsoNormal\" style=\"text-align:left;text-indent: 21pt;\"><o:p>&nbsp;</o:p></p><p class=\"MsoNormal\" style=\"text-align:left;text-indent: 21pt;\"><span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:Calibri;mso-hansi-font-family:\nCalibri\">您声明，您同意接受本条款并注册成为距马科技会员。您是具有法律规定的完全民事权利能力和民事行为能力，能够独立承担民事责任的自然人。不具备前述条件的，您应立即终止注册或停止使用本服务。</span><o:p></o:p></p><p class=\"MsoNormal\"><o:p>&nbsp;</o:p></p><p class=\"MsoNormal\">1<span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:\nCalibri;mso-hansi-font-family:Calibri\">总则</span><o:p></o:p></p><p class=\"MsoNormal\">1.1 <span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:\nCalibri;mso-hansi-font-family:Calibri\">本协议内容包括协议正文、距马科技各单项服务协议及其他距马科技已经发布的或将来可能发布的各类规则，包括但不限于隐私政策、</span><span lang=\"ZH-CN\"> </span><span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:\nCalibri;mso-hansi-font-family:Calibri\">免责声明、</span><span lang=\"ZH-CN\"> </span><span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:Calibri;mso-hansi-font-family:\nCalibri\">知识产权声明、</span><span lang=\"ZH-CN\"> </span><span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:Calibri;mso-hansi-font-family:Calibri\">权利声明、</span><span lang=\"ZH-CN\"> </span><span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:\nCalibri;mso-hansi-font-family:Calibri\">距马科技日租服务协议、分时租赁服务协议等其他协议（“其他条款”）。如果本协议与“其他条款”有不一致之处，则以“其他条款”为准。除另行明确声明外，任何距马科技提供的服务均受本协议约束。</span><o:p></o:p></p><p class=\"MsoNormal\">1.2<span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:\nCalibri;mso-hansi-font-family:Calibri\">距马科技如制订、修改本协议及</span>/<span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:Calibri;mso-hansi-font-family:Calibri\">或各类规则向用户提供基于互联网以及移动网的相关服务的，应在本页面及其相应服务平台页面提前公布通知，您应该定期登陆本页面及其他相关页面，了解最新的协议内容。变更后的协议和规则在本页面及相关页面公布后，将自动生效。如您不同意相关变更，应当立即停止使用距马科技服务。若您在网站协议和规则变更后继续使用距马服务的，即表示您接受已经修订的协议和规则。</span><o:p></o:p></p><p class=\"MsoNormal\">1.3<span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:\nCalibri;mso-hansi-font-family:Calibri\">若您作为距马科技的关联公司或合作公司的用户登陆距马科技平台，访问距马科技网站或使用距马科技服务，即视为您同意本协议的所有条款及距马科技公布的其他规则、说明和操作指引。</span><o:p></o:p></p><p class=\"MsoNormal\"><o:p>&nbsp;</o:p></p><p class=\"MsoNormal\">2<span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:\nCalibri;mso-hansi-font-family:Calibri\">会员</span><o:p></o:p></p><p class=\"MsoNormal\">2.1<span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:\nCalibri;mso-hansi-font-family:Calibri\">凡年龄在</span>18<span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:Calibri;mso-hansi-font-family:Calibri\">周岁（含）以上、持有有效证件、驾龄在</span>1<span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:Calibri;mso-hansi-font-family:\nCalibri\">年以上的会员，均可申请入会。</span><o:p></o:p></p><p class=\"MsoNormal\">2.2<span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:\nCalibri;mso-hansi-font-family:Calibri\">用户可以通过距马科技网站、智行家</span>APP<span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:Calibri;mso-hansi-font-family:\nCalibri\">、客服中心或门店进行免费注册，注册后经距马科技审核后生效；用户资料一旦审核通过，距马科技将在第一时间与用户联系，并为用户提供会员卡寄送服务。</span><o:p></o:p></p><p class=\"MsoNormal\">2.3 <span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:\nCalibri;mso-hansi-font-family:Calibri\">在您完成注册申请手续后，意味着您已获得距马科技账户（会员）的使用权。您应提供及时、详尽及准确的个人资料，并不断更新注册资料，符合及时、详尽准确的要求。您应妥善保管您的账户和密码，通过您的账户和密码操作或实施的行为，将视为您本人的行为，由您本人承担相应的责任和后果。如果您发现他人不当使用您的账户或有任何其他可能危及您的账户安全的情形时，您应当立即以书面、有效方式通知距马科技，要求距马科技暂停相关服务。在此，您理解距马科技对您的请求采取行动需要合理时间，距马科技对在采取行动前已经产生的后果（包括但不限于您的任何损失）不承担任何责任。</span><o:p></o:p></p><p class=\"MsoNormal\"><o:p>&nbsp;</o:p></p><p class=\"MsoNormal\">3. <span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-famil