权利就任何主体侵权而单独提起诉讼，并获得赔偿。本协议已经构成《著作权法》第二十五条所规定的书面协议，其效力及于用户通过互联网或移动终端等设备访问距马科技发布的任何受著作权法保护的作品内容，无论该内容形成于本协议签订前还是本协议签订后。对于您提供的其他资料及数据信息，您授予距马科技及其关联公司全球通用的、永久的、免费的许可使用权利</span>(<span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:Calibri;\nmso-hansi-font-family:Calibri\">并有权在多个层面对该权利进行再授权</span>)<span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:Calibri;mso-hansi-font-family:Calibri\">。此外，距马科技及其关联公司有权</span>(<span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:Calibri;mso-hansi-font-family:\nCalibri\">全部或部份地</span>) <span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:\nCalibri;mso-hansi-font-family:Calibri\">使用、复制、修订、改写、发布、翻译、分发、执行和展示您的全部资料数据（包括但不限于交易行为数据及全部展示于距马科技平台的各类信息）或制作其派生作品，并以现在已知或日后开发的任何形式、媒体或技术，将上述信息纳入距马科技作品内。</span><o:p></o:p></p><p class=\"MsoNormal\"><span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:\nCalibri;mso-hansi-font-family:Calibri\">用户浏览、复制、打印和传播距马科技其他用户上传到距马科技网站的内容，应保证仅用于个人欣赏之目的，不得用于商业目的，不得侵犯权利人的合法权益以及距马科技的合法权益和商业利益。任何用户违反此条规定的，距马科技均有权以自身名义利用法律手段寻求权利救济或据本协议追究您的违约责任。</span><o:p></o:p></p><p class=\"MsoNormal\"><o:p>&nbsp;</o:p></p><p class=\"MsoNormal\">4.2 <span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:\nCalibri;mso-hansi-font-family:Calibri\">距马科技专属权利</span><o:p></o:p></p><p class=\"MsoNormal\">4.2.1<span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:\nCalibri;mso-hansi-font-family:Calibri\">除明显归属于合作伙伴、第三方所有的信息资料外，距马科技拥有网络服务内所有内容，包括但不限于文字、图片、图形、表格、动画、程序、软件等单独或组合的版权。任何被授权的浏览、复制、打印和传播属于本网站内的内容必须符合以下条件：</span><o:p></o:p></p><p class=\"MsoNormal\">1) <span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:\nCalibri;mso-hansi-font-family:Calibri\">所有的资料和图象均以获得信息为目的；</span><o:p></o:p></p><p class=\"MsoNormal\">2) <span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:\nCalibri;mso-hansi-font-family:Calibri\">所有的资料和图象均不得用于商业目的；</span><o:p></o:p></p><p class=\"MsoNormal\">3) <span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-