le=\"font-family:宋体;mso-ascii-font-family:\nCalibri;mso-hansi-font-family:Calibri\">其他违反法律规定的行为。</span><o:p></o:p></p><p class=\"MsoNormal\">4.2.3 <span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:\nCalibri;mso-hansi-font-family:Calibri\">“距马科技”、“智行家”、“</span>vway.me<span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:Calibri;mso-hansi-font-family:\nCalibri\">”和距马科技</span>LOGO<span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:\nCalibri;mso-hansi-font-family:Calibri\">等为距马科技的注册商标，受法律的保护。任何用户不得侵犯距马科技的注册商标权。</span><o:p></o:p></p><p class=\"MsoNormal\"><o:p>&nbsp;</o:p></p><p class=\"MsoNormal\">5. <span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:\nCalibri;mso-hansi-font-family:Calibri\">其他</span><o:p></o:p></p><p class=\"MsoNormal\">5.1.<span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:\nCalibri;mso-hansi-font-family:Calibri\">本协议的订立、执行和解释及争议的解决均应适用中华人民共和国法律。</span><o:p></o:p></p><p class=\"MsoNormal\">5.2.<span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:\nCalibri;mso-hansi-font-family:Calibri\">如双方就本协议内容或其执行发生任何争议，双方应尽量友好协商解决；协商不成时，任何一方均可向距马</span>(<span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:Calibri;mso-hansi-font-family:\nCalibri\">上海</span>)<span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:\nCalibri;mso-hansi-font-family:Calibri\">科技有限公司所在地的人民法院提起诉讼。</span><o:p></o:p></p><p class=\"MsoNormal\">5.3.<span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:\nCalibri;mso-hansi-font-family:Calibri\">距马科技未行使或执行本服务协议任何权利或规定，不构成对前述权利或权利之放弃。</span><o:p></o:p></p><p class=\"MsoNormal\">5.4.<span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:\nCalibri;mso-hansi-font-family:Calibri\">如本协议中的任何条款无论因何种原因完全或部分无效或不具有执行力，本协议的其余条款仍应有效并且有约束力。</span><o:p></o:p></p><p class=\"MsoNormal\">&nbsp;&nbsp;</p><p class=\"MsoNormal\" style=\"text-indent:21.0pt\"><span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:Calibri;mso-hansi-font-family:Calibri\">所有的修订将在距马科技官网和智行家</span>APP<span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:Calibri;mso-hansi-font-family:\nCalibri\">公布。</span><o:p></o:p></p><p class=\"MsoNormal\"><o:p>&nbsp;</o:p></p><p class=\"MsoNormal\"><o:p>&nbsp;</o:p></p><p class=\"MsoNormal\"><o:p>&nbsp;</o:p></p><h1 align=\"center\" style=\"text-align:center\"><strong><span lang=\"ZH-CN\" style=\"font-size:14.0pt;font-family:宋体;mso-ascii-font-family:\nCalibri;mso-hansi-font-family:Calibri;color:#4F81BD\">车辆日租服务协议</span></strong><o:p></o:p></h1><p class=\"MsoNormal\"><br/>1. <span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:Calibri;\nmso-hansi-font-family:Calibri\">总则</span><o:p></o:p></p><p class=\"MsoNormal\" style=\"text-indent:21.0pt\"><span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:Calibri;mso-hansi-font-family:Calibri\">车辆日租服务是距马科技服务产品。如果本协议与及其他距马科技已经发布的或将来可能发布的各类规则，包括但不限于隐私政策、</span><span lang=\"ZH-CN\"> </span><span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:\nCalibri;mso-hansi-font-family:Calibri\">免责声明、</span><span lang=\"ZH-CN\"> </span><span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:Calibri;mso-hansi-font-family:\nCalibri\">知识产权声明、</span><span lang=\"ZH-CN\"> </span><span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:Calibri;mso-hansi-font-family:Calibri\">权利声明、</span><span lang=\"ZH-CN\"> </span><span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:\nCalibri;mso-hansi-font-family:Calibri\">距马科技日租服务协议、分时租赁服务协议等其他协议（“其他条款”）有不一致之处，则以本协议为准。</span><o:p></o:p></p><p class=\"MsoNormal\"><o:p>&nbsp;</o:p></p><p class=\"MsoNormal\">2 <span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:\nCalibri;mso-hansi-font-family:Calibri\">车辆预定</span><o:p></o:p></p><p class=\"MsoNormal\">2.1. <span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:\nCalibri;mso-hansi-font-family:Calibri\">手机会员端预订：在距马官网、智行家公众号和应用市场下载智行家</span>APP<span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:Calibri;mso-hansi-font-family:\nCalibri\">，根据提示进行注册和审核后，进行预订。</span><o:p></o:p></p><p class=\"MsoNormal\">2.2. <span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:\nCalibri;mso-hansi-font-family:Calibri\">电话预订：会员可致电距马科技会员服务中心电话，客服人员将为您安排订车。</span><o:p></o:p></p><p class=\"MsoNormal\">2.3. <span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:\nCalibri;mso-hansi-font-family:Calibri\">门店预订：会员光临距马科技门店，门店人员将为您安排预订或协助您选租车辆。</span><o:p></o:p></p><p class=\"MsoNormal\">2.4 <span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:\nCalibri;mso-hansi-font-family:Calibri\">为不影响您的行程，建议您提前预订车辆；送车上门服务仅在工作时间提供，请您务必提前</span>4<span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:Calibri;mso-hansi-font-family:\nCalibri\">个工作小时预订。</span><o:p></o:p></p><p class=\"MsoNormal\">2.5 <span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:\nCalibri;mso-hansi-font-family:Calibri\">会员预订车辆时，须冻结相应款项作为租车保证金，保证金支付方式有两种：</span><o:p></o:p></p><p class=\"MsoNormal\">2.5.1 <span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:\nCalibri;mso-hansi-font-family:Calibri\">普通会员为个人储值保证金。请使用智行家</span>APP<span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:Calibri;mso-hansi-font-family:\nCalibri\">在线支付保证金</span>, <span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:\nCalibri;mso-hansi-font-family:Calibri\">或到距马科技服务中心支付；</span><o:p></o:p></p><p class=\"MsoNormal\">2.5.2&nbsp; <span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:Calibri;mso-hansi-font-family:\nCalibri\">企业会员使用各企业账户中的保证金。</span><o:p></o:p></p><p class=\"MsoNormal\">2.6 <span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:\nCalibri;mso-hansi-font-family:Calibri\">成功提交订单并支付后，我们将为您预留车辆。</span><o:p></o:p></p><p class=\"MsoNormal\">2.7 <span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:\nCalibri;mso-hansi-font-family:Calibri\">在特殊情况（如车辆故障灯）无法向您提供已成功预订的车型时：</span><o:p></o:p></p><p class=\"MsoNormal\">2.7.1<span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:\nCalibri;mso-hansi-font-family:Calibri\">　我们将为您调整同级别车辆或免费升级车辆；</span><o:p></o:p></p><p class=\"MsoNormal\">2.7.2<span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:\nCalibri;mso-hansi-font-family:Calibri\">　确实无车提供的，我们将补偿您订单首日车辆租赁费或同等金额的代金券。</span><o:p></o:p></p><p class=\"MsoNormal\"><o:p>&nbsp;</o:p></p><p class=\"MsoNormal\">3 <span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:\nCalibri;mso-hansi-font-family:Calibri\">租赁价格和支付</span><o:p></o:p></p><p class=\"MsoNormal\">3.1 <span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:\nCalibri;mso-hansi-font-family:Calibri\">车辆租赁单价、基本保险费、附加保险费、手续费、车辆保证金等以智行家系统当时数据为准。</span><o:p></o:p></p><p class=\"MsoNormal\">3.2 <span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:\nCalibri;mso-hansi-font-family:Calibri\">租赁天数按订单跨越的自然日计数。租期小于</span>1<span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:Calibri;mso-hansi-font-family:\nCalibri\">天的，按</span>1<span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:\nCalibri;mso-hansi-font-family:Calibri\">天收取车辆租赁费</span>; <span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:Calibri;mso-hansi-font-family:Calibri\">租期超过</span>1<span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:Calibri;mso-hansi-font-family:\nCalibri\">天的，租期内整天的部分，按天收取车辆租赁费。租期内非整天的部分，也按一天来计算。</span><o:p></o:p></p><p class=\"MsoNormal\">3.3 <span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:\nCalibri;mso-hansi-font-family:Calibri\">车辆租赁费、基本保险费，手续费均为租车必付费用。</span><o:p></o:p></p><p class=\"MsoNormal\">3.4&nbsp;<span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:\nCalibri;mso-hansi-font-family:Calibri\">请您在提交订单后</span>30<span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:Calibri;mso-hansi-font-family:Calibri\">分钟内完成保证金支付和租赁费预付（预付项目及金额以系统显示为准），逾时未付，订单将自动取消。</span><o:p></o:p></p><p class=\"MsoNormal\">3.5&nbsp;<span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:\nCalibri;mso-hansi-font-family:Calibri\">保证金和会员账户用为两个独立账户。保证金余额不能用于支付订单费用。会员账户余额也不能作为保证金。</span><o:p></o:p></p><p class=\"MsoNormal\"><o:p>&nbsp;</o:p></p><p class=\"MsoNormal\">4. <span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:\nCalibri;mso-hansi-font-family:Calibri\">订单修改和取消</span><o:p></o:p></p><p class=\"MsoNormal\">4.1 <span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:\nCalibri;mso-hansi-font-family:Calibri\">为不影响您和其他会员的既定行程，在您修改订单起止时间时，请在原取车、还车时间点提前至少</span>2<span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:Calibri;mso-hansi-font-family:\nCalibri\">个工作小时提交修改。</span><o:p></o:p></p><p class=\"MsoNormal\">4.2&nbsp;<span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:\nCalibri;mso-hansi-font-family:Calibri\">距离预订取车时间不足</span>2<span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:Calibri;mso-hansi-font-family:Calibri\">个工作小时的订单，不能修改取车时间。距离预订还车车时间不足</span>2<span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:Calibri;mso-hansi-font-family:\nCalibri\">个工作小时的订单，不能修改还车时间。</span><o:p></o:p></p><p class=\"MsoNormal\">4.3 <span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:\nCalibri;mso-hansi-font-family:Calibri\">修改订单取还车方式（如送车上门），请您在原取还车时间点提前至少</span>4<span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:Calibri;mso-hansi-font-family:\nCalibri\">个工作小时修改。</span><o:p></o:p></p><p class=\"MsoNormal\">4.4<span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:\nCalibri;mso-hansi-font-family:Calibri\">取消订单需提前一天在智行家</span>APP<span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:Calibri;mso-hansi-font-family:Calibri\">中进行。订单计划取车时间当天，订单不能在</span>APP<span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:Calibri;mso-hansi-font-family:\nCalibri\">中取消。如必须取消</span>, <span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:\nCalibri;mso-hansi-font-family:Calibri\">请联系客服处理。由客服取消的订单，其预付款中的基本保险、可选服务费将退还给您，但将扣除手续费和一天车辆租赁费将作为违约金。</span><o:p></o:p></p><p class=\"MsoNormal\">4.5 <span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:\nCalibri;mso-hansi-font-family:Calibri\">提前还车申请成功后，如果租赁天数少于原有天数，将退还多余的租金和服务费。</span><span lang=\"ZH-CN\"> </span><o:p></o:p></p><p class=\"MsoNormal\">4.6 <span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:\nCalibri;mso-hansi-font-family:Calibri\">您对订单的修改将影响到您的预订价格，请您慎重。</span><o:p></o:p></p><p class=\"MsoNormal\">4.7&nbsp;<span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:\nCalibri;mso-hansi-font-family:Calibri\">由于距马科技租车原因导致订单取消的，我们除退还您已付金额外，还将补偿您已付金额等值的代金券。</span><o:p></o:p></p><p class=\"MsoNormal\">4.8&nbsp;<span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:\nCalibri;mso-hansi-font-family:Calibri\">若行程已经开始，双方无正当理由，无权再取消订单。</span><o:p></o:p></p><p class=\"MsoNormal\">4.9&nbsp;<span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:\nCalibri;mso-hansi-font-family:Calibri\">在没有征得距马科技同意，超出约定范围驾驶车辆，或者延长车辆使用时间，则我方有权中途取消订单而不需支付违约金。</span><o:p></o:p></p><p class=\"MsoNormal\"><o:p>&nbsp;</o:p></p><p class=\"MsoNormal\">5<span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:\nCalibri;mso-hansi-font-family:Calibri\">取车和验车</span><o:p></o:p></p><p class=\"MsoNormal\">5.1 <span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:\nCalibri;mso-hansi-font-family:Calibri\">会员取车请携带有效身份证明（身份证、港澳居民来往内地通行证、大陆通行证、护照）、国内驾驶证（正副本）、智行家会员卡</span>,<span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:Calibri;\nmso-hansi-font-family:Calibri\">按预定的时间到达取车地点。</span><o:p></o:p></p><p class=\"MsoNormal\">5.2 <span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:\nCalibri;mso-hansi-font-family:Calibri\">距马科技调度员将在取车地点验证会员证件和订单信息。</span><o:p></o:p></p><p class=\"MsoNormal\">5.3 <span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:\nCalibri;mso-hansi-font-family:Calibri\">距马科技调度员填写《放车、收车登记表》，应与会员一道，当面检查车辆外观是否有损伤；转向系统、刹车系统、润滑系统、冷却液、轮胎、车外灯光、各种指示灯、仪表显示、空调、音响、导航仪、倒车雷达、车窗门锁和遥控、雨刮器、引擎盖、油箱盖、后背箱等是否正常。验车后，应逐项填写《汽车检验单》一式三份，并交会员一份。</span><o:p></o:p></p><p class=\"MsoNormal\">5.4&nbsp;<span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:\nCalibri;mso-hansi-font-family:Calibri\">会员使用车辆之前，须先确认车辆电量满足本次出行里程要求，若电量不足，请不要驾驶离开，立即通知距马科技客服中心结束该订单，重新预订其它车辆。因会员未确定电量或因估算不足，造成行驶过程中将电量耗尽引发的拖车费用以及由此给距马科技造成的一切经济损失及法律责任均由会员承担。</span><o:p></o:p></p><p class=\"MsoNormal\">5.5 <span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:\nCalibri;mso-hansi-font-family:Calibri\">根据所租车辆性能和特点，距马科技调度员向会员讲解操作方法和注意事项，指导会员正确使用操作车辆。避免造成人为车辆损坏。</span><o:p></o:p></p><p class=\"MsoNormal\">5.6 <span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:\nCalibri;mso-hansi-font-family:Calibri\">车辆显示的续航里程表示在理想状态下可达公里数，实际续航里程会因温度、交通状况、驾驶习惯等因素而不同。</span><o:p></o:p></p><p class=\"MsoNormal\">5.7 <span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:\nCalibri;mso-hansi-font-family:Calibri\">会员出发前，确认车辆驾驶无异常，车辆车灯、刹车、车窗等无问题，以保障您的用车安全。</span><o:p></o:p></p><p class=\"MsoNormal\">5.8&nbsp;<span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:\nCalibri;mso-hansi-font-family:Calibri\">如需提前和延时取车</span>, <span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:Calibri;mso-hansi-font-family:Calibri\">请提前在智行家</span>APP<span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:Calibri;mso-hansi-font-family:\nCalibri\">中修改订单</span>, <span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:\nCalibri;mso-hansi-font-family:Calibri\">或致电距马科技客服修改订单。</span><o:p></o:p></p><p class=\"MsoNormal\">5.9&nbsp;<span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:\nCalibri;mso-hansi-font-family:Calibri\">超过预订取车时间半小时如果您未取车，</span><span lang=\"ZH-CN\"> </span><span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:\nCalibri;mso-hansi-font-family:Calibri\">距马科技视同订单已执行，不能取消。</span><o:p></o:p></p><p class=\"MsoNormal\"><o:p>&nbsp;</o:p></p><p class=\"MsoNormal\">6 <span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:\nCalibri;mso-hansi-font-family:Calibri\">车辆使用</span><o:p></o:p></p><p class=\"MsoNormal\">6.1 <span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:\nCalibri;mso-hansi-font-family:Calibri\">会员若发现车辆仪表盘出现任何警告信息或问题、请立即找到安全地点停车并拨打客服中心，距马科技将为会员安排救援服务</span>,<span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:Calibri;\nmso-hansi-font-family:Calibri\">会员需随时保持通讯畅通。</span><o:p></o:p></p><p class=\"MsoNormal\">6.2 <span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:\nCalibri;mso-hansi-font-family:Calibri\">会员必须遵守交通规则，请勿超速行驶，非特殊情况请勿打开远光灯。</span><o:p></o:p></p><p class=\"MsoNormal\">6.3 <span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:\nCalibri;mso-hansi-font-family:Calibri\">会员在车辆使用过程中，需将车辆停放时，请在熄火关门后进行落锁。</span><o:p></o:p></p><p class=\"MsoNormal\">6.4 <span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:\nCalibri;mso-hansi-font-family:Calibri\">会员在车辆使用过程中，如电量不足，需对车辆进行充电，请确定充电设施符合车辆充电标准，参照《车辆使用说明》。因未按标准违规充电造成的经济损失，距马科技有权对会员进行索赔；会员若需至距马科技网点进行充电，距马科技不保证网点充电桩处于闲置状态或可充状态。</span><o:p></o:p></p><p class=\"MsoNormal\">6.5 <span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:\nCalibri;mso-hansi-font-family:Calibri\">距马科技不对任何会员个人财物的损坏或丢失负责。车内承载、放置或遗留的任何个人财物均不对距马科技构成任何委托责任。</span><o:p></o:p></p><p class=\"MsoNormal\">6.6<span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:\nCalibri;mso-hansi-font-family:Calibri\">会员不得以任何方式将车辆提供给任何第三方驾驶，否则由此产生的后果</span>/<span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:Calibri;mso-hansi-font-family:\nCalibri\">责任均由会员自行承担。</span><o:p></o:p></p><p class=\"MsoNormal\">6.7 <span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:\nCalibri;mso-hansi-font-family:Calibri\">会员应遵守各项法律法规，不得将租赁车辆转卖、抵押、质押、转借、典当、转租租赁车辆及从事营利性营运，不得利用车辆从事不符合其功能的运输。</span><o:p></o:p></p><p class=\"MsoNormal\">6.8 <span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:\nCalibri;mso-hansi-font-family:Calibri\">会员不得将车辆任何非法或粗鲁方式使用；或用于比赛或速度竞赛；或运送易燃易爆物品、化学品、易腐物品或其它有害原材料或任何种类和性质的污染物质。</span><o:p></o:p></p><p class=\"MsoNormal\">6.9 <span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:\nCalibri;mso-hansi-font-family:Calibri\">任何服用酒精、麻醉品或药物的人员不得驾驶，无论其是否在医生的指导下使用上述物品。</span><o:p></o:p></p><p class=\"MsoNormal\">6.10 <span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:\nCalibri;mso-hansi-font-family:Calibri\">会员不得将车辆行驶到任何没有铺设路面的土路上行驶或越野行驶，距马科技以书面形式批准的除外。</span><o:p></o:p></p><p class=\"MsoNormal\">6.11 <span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:\nCalibri;mso-hansi-font-family:Calibri\">车辆不得承载超出核定限乘人数以外的乘客。</span><o:p></o:p></p><p class=\"MsoNormal\">6.12 <span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:\nCalibri;mso-hansi-font-family:Calibri\">会员不得拆除车内配备的任何物品。会员违反使用限制，将承担因此而造成的全部法律责任和经济赔偿责任。距马科技可在不向会员发出通知的情况下，终止其使用车辆的权利和会员资格。距马科技保留法律规定的权利，包括但不限于不经过法律程序向会员发出通知而回收车辆，并由此产生的一切直接或间接费用，全由会员承担。若会员拒付相关损失，距马科技有权不予退还保证金并有权继续索赔。</span><o:p></o:p></p><p class=\"MsoNormal\"><o:p>&nbsp;</o:p></p><p class=\"MsoNormal\">6 <span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:\nCalibri;mso-hansi-font-family:Calibri\">还车和验车</span><o:p></o:p></p><p class=\"MsoNormal\">6.1 <span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:\nCalibri;mso-hansi-font-family:Calibri\">会员应按预定的时间前到达还车地点。</span><o:p></o:p></p><p class=\"MsoNormal\">6.2&nbsp;<span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:\nCalibri;mso-hansi-font-family:Calibri\">会员还车时，调度员收回车钥匙、行驶证和车内临时配置物品，查看和记录会员租车行驶里程数和还车时间。对照交车时填写的《交车、还车登记表》记录，逐项核对，仔细全面检查车况和随车工具，如实对应项目内容。</span><o:p></o:p></p><p class=\"MsoNormal\">6.3 <span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:\nCalibri;mso-hansi-font-family:Calibri\">会员未按时还车</span>, <span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:Calibri;mso-hansi-font-family:Calibri\">订单计费天数将按实际还车时间重新计算。</span><o:p></o:p></p><p class=\"MsoNormal\">6.4 <span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:\nCalibri;mso-hansi-font-family:Calibri\">距马科技收车验收后，当场计算出会员租车天数（含车辆损坏修复停驶时间）和其它应收费用。将数据填写《交车、还车登记表》对应项目内容中，经会员签名确认后作为结算依据。</span><o:p></o:p></p><p class=\"MsoNormal\"><o:p>&nbsp;</o:p></p><p class=\"MsoNormal\">7<span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:\nCalibri;mso-hansi-font-family:Calibri\">费用项目</span><o:p></o:p></p><p class=\"MsoNormal\">7.1 <span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:\nCalibri;mso-hansi-font-family:Calibri\">租金费用：车辆租赁费用和其他费用，具体计费方式请参见智行家</span>APP <span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:Calibri;mso-hansi-font-family:\nCalibri\">或咨询客服中心。</span><o:p></o:p></p><p class=\"MsoNormal\">7.2&nbsp;<span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:\nCalibri;mso-hansi-font-family:Calibri\">手续费：会员卡遗失补办手续费</span>20<span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:Calibri;mso-hansi-font-family:Calibri\">元。</span><o:p></o:p></p><p class=\"MsoNormal\">7.3&nbsp;<span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:\nCalibri;mso-hansi-font-family:Calibri\">救援费：非车辆本身故障导致车辆无法正常行驶时（包含且不限于电量行至低电量状态导致车辆无法行驶、人为操作失误、保险事故等），救援产生的费用由会员承担。</span><o:p></o:p></p><p class=\"MsoNormal\">7.4 <span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:\nCalibri;mso-hansi-font-family:Calibri\">经营损失费：因会员操作不当造成的车辆故障、事故，以及违规使用导致车辆被扣或证件丢失或证件被扣或证件借用处理违章或无法年检等情形而影响车辆正常运营的，距马科技按照车辆每日租金与实际停运天数向会员收取经营损失费，若会员拒付，距马科技不予退还保证金并有权继续索赔。</span><o:p></o:p></p><p class=\"MsoNormal\"><o:p>&nbsp;</o:p></p><p class=\"MsoNormal\">8&nbsp;<span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:\nCalibri;mso-hansi-font-family:Calibri\">保险和赔偿</span><o:p></o:p></p><p class=\"MsoListParagraphCxSpFirst\" style=\"margin-left:.25in;mso-add-space:auto;\ntext-indent:-.25in;mso-list:l0 level2 lfo1\"><!--[if !supportLists]-->8.1<span style=\"font-stretch: normal; font-size: 7pt; font-family: &#39;Times New Roman&#39;;\">&nbsp;&nbsp;</span><!--[endif]--><span lang=\"ZH-CN\" style=\"font-family:宋体;\nmso-ascii-font-family:Calibri;mso-hansi-font-family:Calibri\">会员还车时，出现车内物品丢失，应照价赔偿。</span><o:p></o:p></p><p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left:0in;mso-add-space:auto;\ntext-indent:0in;mso-list:l0 level2 lfo1\"><!--[if !supportLists]-->8.2<span style=\"font-stretch: normal; font-size: 7pt; font-family: &#39;Times New Roman&#39;;\">&nbsp;&nbsp;&nbsp;</span><span lang=\"ZH-CN\" style=\"font-family:宋体;\nmso-ascii-font-family:Calibri;mso-hansi-font-family:Calibri\">购买基本保险后，在理赔范围内有一定的免赔额度需会员承担，如需免除此额度，请另外选购可选服务。</span><o:p></o:p></p><p class=\"MsoListParagraphCxSpLast\" style=\"margin-left:.25in;mso-add-space:auto;\ntext-indent:-.25in;mso-list:l0 level2 lfo1\"><!--[if !supportLists]-->8.3<span style=\"font-stretch: normal; font-size: 7pt; font-family: &#39;Times New Roman&#39;;\">&nbsp;&nbsp;</span><!--[endif]--><span lang=\"ZH-CN\" style=\"font-family:宋体;\nmso-ascii-font-family:Calibri;mso-hansi-font-family:Calibri\">基本保险覆盖范围交强险、车辆损失险、第三者责任险，投保额参见如下明细</span><o:p></o:p></p><table class=\"MsoNormalTable\" border=\"0\" cellspacing=\"0\" cellpadding=\"0\" style=\"margin-left:-.1pt;border-collapse:collapse;mso-padding-alt:0in .5pt 0in .5pt\"><tbody><tr style=\"mso-yfti-irow:0;mso-yfti-firstrow:yes;height:.05pt\"><td width=\"94\" valign=\"top\" style=\"width:70.25pt;border:solid black 1.0pt;\n  mso-border-alt:solid black .75pt;padding:0in 0in 0in 0in;height:.05pt\"><p class=\"MsoNormal\" style=\"text-align:left;\"><span style=\"font-size:\n  10.0pt;font-family:宋体;mso-bidi-font-family:宋体\"><o:p>&nbsp;</o:p></span></p></td><td width=\"232\" valign=\"top\" style=\"width:174.2pt;border:solid black 1.0pt;\n  border-left:none;mso-border-left-alt:solid black .75pt;mso-border-alt:solid black .75pt;\n  padding:0in 0in 0in 0in;height:.05pt\"><p class=\"MsoNormal\" style=\"text-align:left;\"><span lang=\"ZH-CN\" style=\"font-size:10.0pt;font-family:宋体;mso-bidi-font-family:宋体\">投保险种</spa