nt-family:Calibri\">如发生事故的，会员须协助距马科技向保险公司进行理赔，因会员拒绝协助导致的一切经济损失，距马科技有权对会员进行索赔。会员应如实提供交通管理部门、保险公司出具的事故证明、责任裁定书、事故调解书、判决书等文件。</span><o:p></o:p></p><p class=\"MsoNormal\">8.6&nbsp;<span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:\nCalibri;mso-hansi-font-family:Calibri\">因会员使用不当或会员是交通事故主要责任方，并导致车辆单次维修费用超过</span>2000<span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:Calibri;mso-hansi-font-family:\nCalibri\">元的，超出</span>2000<span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:\nCalibri;mso-hansi-font-family:Calibri\">元的金额部分，会员须按</span>20%<span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:Calibri;mso-hansi-font-family:Calibri\">作为车辆现值损失支付给距马科技。</span><o:p></o:p></p><p class=\"MsoNormal\">8.7&nbsp;<span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:\nCalibri;mso-hansi-font-family:Calibri\">会员租期内的违章及相关费用由会员自行承担，距马科技租车将短信通知会员租期内的车辆违章。会员除应及时完成违章处理、缴清罚款外还应承担由此造成交强险上浮费用</span>100<span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:Calibri;mso-hansi-font-family:\nCalibri\">元</span>/<span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:\nCalibri;mso-hansi-font-family:Calibri\">次。</span><o:p></o:p></p><p class=\"MsoNormal\">8.8&nbsp;<span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:\nCalibri;mso-hansi-font-family:Calibri\">租赁期内会员发生交通事故的，会员并被认定为主要事故责任人的，除应及时报案完成事故处理并承担保险金额以外的赔偿外，会员还应承担由事故造成的保险费上浮费</span>300<span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:Calibri;mso-hansi-font-family:\nCalibri\">元</span>/<span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:\nCalibri;mso-hansi-font-family:Calibri\">次，最高</span>900<span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:Calibri;mso-hansi-font-family:Calibri\">元。</span><o:p></o:p></p><p class=\"MsoNormal\">8.9 <span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:\nCalibri;mso-hansi-font-family:Calibri\">上述费用发生后，距马科技填写《会员车损和其它费用赔偿结算单》后会员签字认可，作为结算依据。会员需在</span>10<span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:Calibri;mso-hansi-font-family:\nCalibri\">个工作日内支付给距马科技。如会员未及时支付，视为会员违约，距马科技有权直接从保证金中直接扣除赔偿，不足部分由会员补足。</span><o:p></o:p></p><p class=\"MsoNormal\">8.10&nbsp;<span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:\nCalibri;mso-hansi-font-family:Calibri\">用车过程中如有事故或需指导，请立即致电客服中心。</span><o:p></o:p></p><p class=\"MsoNormal\"><o:p>&nbsp;</o:p></p><p class=\"MsoNormal\">9<span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:\nCalibri;mso-hansi-font-family:Calibri\">退款</span><o:p></o:p></p><p class=\"MsoNormal\">9.1 <span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:\nCalibri;mso-hansi-font-family:Calibri\">订单取消和修改后如有退还金额，将扣除违约费用后退回剩余金额。无论下单时使用何种支付方式，退还金额均转入会员账户余额。</span><o:p></o:p></p><p class=\"MsoNormal\">9.2&nbsp;<span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:\nCalibri;mso-hansi-font-family:Calibri\">会员账户余额可永久使用，不能退还。</span><span lang=\"ZH-CN\"> </span><o:p></o:p></p><p class=\"MsoNormal\">9.3&nbsp;<span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:\nCalibri;mso-hansi-font-family:Calibri\">会员保证金将在会员提交退保证金申请后</span>45-50<span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:Calibri;mso-hansi-font-family:\nCalibri\">个工作日退还，退款进度查询请致电客服中心。</span><o:p></o:p></p><p class=\"MsoNormal\"><o:p>&nbsp;</o:p></p><p class=\"MsoNormal\"><o:p>&nbsp;</o:p></p><p class=\"MsoNormal\"><o:p>&nbsp;</o:p></p><h1 align=\"center\" style=\"text-align:center\"><strong><span lang=\"ZH-CN\" style=\"font-size:14.0pt;font-family:宋体;mso-ascii-font-family:\nCalibri;mso-hansi-font-family:Calibri;color:#4F81BD\">分时租赁服务协议</span></strong><o:p></o:p></h1><p class=\"MsoNormal\"><span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:\nCalibri;mso-hansi-font-family:Calibri\">欢迎您使用距马科技车辆分时租赁服务。</span><span lang=\"ZH-CN\"> </span><span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:\nCalibri;mso-hansi-font-family:Calibri\">距马科技提醒您：在使用车辆分时租赁服务前，请您务必仔细阅读并透彻