oNormal\">2. <span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:\nCalibri;mso-hansi-font-family:Calibri\">任何由于计算机病毒侵入或发作、政府管制等造成的暂时性关闭，使网络无法正常运行而造成的个人资料泄露、丢失、被盗用或被窜改；</span><o:p></o:p></p><p class=\"MsoNormal\">3. <span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:\nCalibri;mso-hansi-font-family:Calibri\">由于与本网站链接的其他网站所造成个人资料泄露及由此而导致的任何法律争议和后果；</span><o:p></o:p></p><p class=\"MsoNormal\">4. <span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:\nCalibri;mso-hansi-font-family:Calibri\">因不可抗力而引起的任何后果。</span><o:p></o:p></p><p class=\"MsoNormal\">5. <span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:\nCalibri;mso-hansi-font-family:Calibri\">根据《中华人民共和国宪法》和相关法律法规规定，在保护公民合法言论自由的同时，禁止利用互联网、通讯工具、媒体以及其他方式从事以下行为：</span><o:p></o:p></p><p class=\"MsoNormal\">6. <span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:\nCalibri;mso-hansi-font-family:Calibri\">组织、煽动抗拒、破坏宪法和法律、法规实施的。捏造或者歪曲事实，散布谣言，妨害社会管理秩序的。组织、煽动非法集会、游行、示威、扰乱公共场所秩序的；</span><o:p></o:p></p><p class=\"MsoNormal\">7. <span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:\nCalibri;mso-hansi-font-family:Calibri\">从事其他侵犯国家、社会、集体利益和公民合法权益的。管理部门将依法严加监管上述行为并予以处理；对构成犯罪的，司法机关将追究刑事责任。</span><o:p></o:p></p><p class=\"MsoNormal\"><o:p>&nbsp;</o:p></p><p class=\"MsoNormal\" style=\"text-indent:21.0pt\"><span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:Calibri;mso-hansi-font-family:Calibri\">任何单位或个人认为通过距马科技的内容可能涉嫌侵犯其合法权益，应该及时向距马科技或服务网站书面反馈，并提供身份证明、权属证明及详细侵权情况证明，距马科技在收到上述法律文件后，将会尽快移除被控侵权内容。</span><o:p></o:p></p><p class=\"MsoNormal\"><o:p>&nbsp;</o:p></p><p class=\"MsoNormal\" style=\"text-indent:21.0pt\"><span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:Calibri;mso-hansi-font-family:Calibri\">本声明适用中华人民共和国法律，您和距马科技一致同意服从上海市浦东新区人民法院管辖。如其中任何条款与中华人民共和国法律相抵触时，则这些条款将完全按法律规定重新解释，而其它条款依旧具有法律效力。</span><o:p></o:p></p><p style=\"margin-top:0in;margin-right:0in;margin-bottom:7.5pt;margin-left:0in;\nline-height:18.0pt;background:white;vertical-align:baseline\"><span style=\"font-size:10.5pt;font-family:&quot;inherit&quot;,&quot;serif&quot;;mso-fareast-font-family:\n宋体;mso-bidi-font-family:Tahoma;color:#555555\"><o:p>&nbsp;</o:p></span></p><p class=\"MsoNormal\" style=\"text-align:left;\"><span style=\"font-size:10.0pt;mso-font-kerning:0pt\"><o:p>&nbsp;</o:p></span></p><h1 align=\"center\" style=\"text-align:center\"><strong><span lang=\"ZH-CN\" style=\"font-size:14.0pt;font-family:宋体;mso-ascii-font-family:\nCalibri;mso-hansi-font-family:Calibri;color:#4F81BD\">隐私政策</span></strong><o:p></o:p></h1><p class=\"MsoNormal\" style=\"text-indent:21.0pt\"><span lang=\"ZH-CN\" style=\"font-family:宋体;mso-bidi-font-family:宋体\">距马科技非常重视对您隐私的保护，请您仔细阅读如下声明。当您访问距马科技网站或使用距马科技提供的服务前，您需要同意隐私政策中具体解释的收集、使用、公布和以其它形式运用您或您的被代理人的个人信息的政策。如果您不同意隐私政策中的任何内容，请立即停止使用距马科技服务或访问距马科技网站或移动会员端程序。</span><span style=\"font-family:宋体;mso-bidi-font-family:宋体\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-indent:21.0pt\"><span lang=\"ZH-CN\" style=\"font-family:宋体;mso-bidi-font-family:宋体\">为了给您提供更准确、更有针对性的服务，距马科技可能会以如下方式，使用您提交的个人信息，但距马科技会以高度的勤勉义务对待这些信息。如果您对我们的隐私保护条款有任何疑问或建议，请发邮件给</span><span style=\"font-family:宋体;mso-bidi-font-family:宋体\"><a href=\"mailto:support@vway.me\">support@vway.me</a><span lang=\"ZH-CN\">。</span><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-indent:21.0pt\"><span style=\"font-family:宋体;\nmso-bidi-font-family:宋体\">&nbsp;</span></p><p class=\"MsoNormal\"><span lang=\"ZH-CN\" style=\"font-family:宋体;mso-bidi-font-family:\n宋体\">我们从您那里获得的资料</span><span style=\"font-family:宋体;mso-bidi-font-family:宋体\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-indent:21.0pt\"><span lang=\"ZH-CN\" style=\"font-family:宋体;mso-bidi-font-family:宋体\">距马科技会在您自愿选择服务或提供信息的情况下收集您的个人信息（简称</span><span style=\"font-family:宋体;mso-bidi-font-family:宋体\">“<span lang=\"ZH-CN\">个人信息</span>”<span lang=\"ZH-CN\">），例如您的姓名、邮件地址、电话号码、订单信息、交易记录及其他身份信息等。我们有可能会保留一些用户的使用习惯信息（出行相关），用于更好地了解和服务于用户。这些数据将有利于我们开发出更符合用户需求的功能、信息和服务。同时，这些信息将用于显示目标广告。</span><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-indent:21.0pt\"><span lang=\"ZH-CN\" style=\"font-family:宋体;mso-bidi-font-family:宋体\">我们可能会收集一些特定的关于您所使用的机器的技术信息，这些信息将用于提供更好的用户使用体验，提供更方便的服务，我们所收集的技术信息可能会包括：</span><span style=\"font-family:宋体;mso-bidi-font-family:宋体\">IP<span lang=\"ZH-CN\">地址、操作系统版本、浏览器版本、显示器分辨率，推荐网站等。</span><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-indent:21.0pt\"><span lang=\"ZH-CN\" style=\"font-family:宋体;mso-bidi-font-family:宋体\">此外，我们还可能从其他合法来源收到关于您的信息并且将其加入我们的会员信息库。</span><span style=\"font-family:宋体;mso-bidi-font-family:宋体\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-indent:21.0pt\"><span style=\"font-family:宋体;\nmso-bidi-font-family:宋体\">&nbsp;</span></p><p class=\"MsoNormal\"><span lang=\"ZH-CN\" style=\"font-family:宋体;mso-bidi-font-family:\n宋体\">我们如何使用收集的用户信息</span><span style=\"font-family:宋体;mso-bidi-font-family:宋体\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-indent:21.0pt\"><span lang=\"ZH-CN\" style=\"font-family:宋体;mso-bidi-font-family:宋体\">我们利用从所有服务中收集的信息来提供、维护、保护和改进这些服务，同时开发新的服务为您带来更好的用户体验，并提高我们的总体服务品质。经您的许可，我们还会使用此类信息为您提供定制内容，例如向您提供出行产品或服务的预定信息等。</span><span style=\"font-family:宋体;mso-bidi-font-family:宋体\"><o:p></o:p></span></p><p class=\"MsoNormal\"><span style=\"font-family:宋体;mso-bidi-font-family:宋体\">&nbsp;</span></p><p class=\"MsoNormal\"><span lang=\"ZH-CN\" style=\"font-family:宋体;mso-bidi-font-family:\n宋体\">特别授权</span><span style=\"font-family:宋体;mso-bidi-font-family:宋体\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-indent:21.0pt\"><span lang=\"ZH-CN\" style=\"font-family:宋体;mso-bidi-font-family:宋体\">您完全理解并不可撤销地、免费地授予距马科技及其关联公司下列权利：</span><span style=\"font-family:宋体;mso-bidi-font-family:宋体\"><o:p></o:p></span></p><p class=\"MsoNormal\"><span style=\"font-family:宋体;mso-bidi-font-family:宋体\">1<span lang=\"ZH-CN\">、距马科技关联公司或合作公司允许距马科技用户登录关联公司或合作公司并使用其服务，距马科技用户在关联公司或合作公司的任何行为均需遵守该等平台服务协议的约定、平台公布的规则以及有关正确使用平台服务的说明和操作指引。为了实现上述功能，您同意距马科技将您在距马科技的注册信息、交易</span>/<span lang=\"ZH-CN\">支付数据等信息和数据同步至关联公司或合作公司系统并允许其使用。</span><o:p></o:p></span></p><p class=\"MsoNormal\"><span style=\"font-family:宋体;mso-bidi-font-family:宋体\">2<span lang=\"ZH-CN\">、如您以距马科技关联公司或合作公司用户账号和密码登录距马科技，为了实现向您提供同等服务的功能，您同意距马科技将您在关联公司或合作公司账号项下的注册信息、交易</span>/<span lang=\"ZH-CN\">支付数据等信息和数据同步至距马科技系统并进行使用，并且您不会因此追究距马科技以及距马科技关联公司或合作公司的责任。</span><o:p></o:p></span></p><p class=\"MsoNormal\"><span style=\"font-family:宋体;mso-bidi-font-family:宋体\">3<span lang=\"ZH-CN\">、为确保交易安全，允许距马科技及其关联公司对用户信息进行数据分析，并允许距马科技及其关联公司对上述分析结果进行商业利用。</span><o:p></o:p></span></p><p class=\"MsoNormal\"><span style=\"font-family:宋体;mso-bidi-font-family:宋体\">4<span lang=\"ZH-CN\">、您在享受距马科技提供的各项服务的同时，授权并同意接受距马科技向您的电子邮件、手机、通信地址等发送商业信息，包括不限于最新的距马科技产品信息、促销信息等。若您选择不接受距马科技提供的各类信息服务，您可以按照距马科技网提供的相应设置拒绝该类信息服务。</span><o:p></o:p></span></p><p class=\"MsoNormal\"><o:p>&nbsp;</o:p></p><p class=\"MsoNormal\"><span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:\nCalibri;mso-hansi-font-family:Calibri\">我们分享的信</span><span lang=\"ZH-CN\" style=\"font-family:宋体;mso-bidi-font-family:宋体\">息</span><o:p></o:p></p><p class=\"MsoNormal\" style=\"text-indent:21.0pt\"><span lang=\"ZH-CN\" style=\"font-family:宋体;mso-bidi-font-family:宋体\">用户在如下情况下，距马科技会遵照您的意愿或法律的规定披露您的个人信息，由此引发的问题将由您个人承担：</span><o:p></o:p></p><p class=\"MsoNormal\"><span lang=\"ZH-CN\" style=\"font-family:宋体;mso-bidi-font-family:\n宋体\">（</span>1<span lang=\"ZH-CN\" style=\"font-family:宋体;mso-bidi-font-family:宋体\">）事先获得您的授权；</span><o:p></o:p></p><p class=\"MsoNormal\"><span lang=\"ZH-CN\" style=\"font-family:宋体;mso-bidi-font-family:\n宋体\">（</span>2<span lang=\"ZH-CN\" style=\"font-family:宋体;mso-bidi-font-family:宋体\">）只有透露您的个人资料，才能使距马科技或其合作商提供您所要求的产品和服务；</span><o:p></o:p></p><p class=\"MsoNormal\"><span lang=\"ZH-CN\" style=\"font-family:宋体;mso-bidi-font-family:\n宋体\">（</span>3<span lang=\"ZH-CN\" style=\"font-family:宋体;mso-bidi-font-family:宋体\">）根据有关的法律法规要求；</span><o:p></o:p></p><p class=\"MsoNormal\"><span lang=\"ZH-CN\" style=\"font-family:宋体;mso-bidi-font-family:\n宋体\">（</span>4<span lang=\"ZH-CN\" style=\"font-family:宋体;mso-bidi-font-family:宋体\">）按照相关政府主管部门的要求；</span><o:p></o:p></p><p class=\"MsoNormal\"><span lang=\"ZH-CN\" style=\"font-family:宋体;mso-bidi-font-family:\n宋体\">（</span>5<span lang=\"ZH-CN\" style=\"font-family:宋体;mso-bidi-font-family:宋体\">）为维护距马科技的合法权益；</span><o:p></o:p></p><p class=\"MsoNormal\"><span lang=\"ZH-CN\" style=\"font-family:宋体;mso-bidi-font-family:\n宋体\">（</span>6<span lang=\"ZH-CN\" style=\"font-family:宋体;mso-bidi-font-family:宋体\">）您同意让第三方共享资料；</span><o:p></o:p></p><p class=\"MsoNormal\"><span lang=\"ZH-CN\" style=\"font-family:宋体;mso-bidi-font-family:\n宋体\">（</span>7<span lang=\"ZH-CN\" style=\"font-family:宋体;mso-bidi-font-family:宋体\">）我们发现您违反了距马科技公司服务条款或任何其他产品服务的使用规定。</span><o:p></o:p></p><p class=\"MsoNormal\"><o:p>&nbsp;</o:p></p><p class=\"MsoNormal\"><span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:\nCalibri;mso-hansi-font-family:Calibri\">用户对个人信息的控</span><span lang=\"ZH-CN\" style=\"font-family:宋体;mso-bidi-font-family:宋体\">制</span><o:p></o:p></p><p class=\"MsoNormal\" style=\"text-indent:21.0pt\"><span lang=\"ZH-CN\" style=\"font-family:宋体;mso-bidi-font-family:宋体\">距马科技相信用户应该对他</span>/<span lang=\"ZH-CN\" style=\"font-family:宋体;mso-bidi-font-family:宋体\">她的个人信息拥有绝对的控制权，用户可以通过</span><span style=\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">“</span><span lang=\"ZH-CN\" style=\"font-family:宋体;mso-bidi-font-family:宋体\">修改个人信息</span><span style=\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">”</span><span lang=\"ZH-CN\" style=\"font-family:宋体;mso-bidi-font-family:宋体\">查看或修改个人信息。用户自愿注册个人信息，用户在注册时提供的所有信息，都是基于自愿，用户有权在任何时候拒绝提供这些信息。</span><span style=\"font-family:宋体;mso-bidi-font-family:宋体\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-indent:21.0pt\"><o:p>&nbsp;</o:p></p><p class=\"MsoNormal\"><span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:\nCalibri;mso-hansi-font-family:Calibri\">我们如何保护用户的个人信</span><span lang=\"ZH-CN\" style=\"font-family:宋体;mso-bidi-font-family:宋体\">息</span><o:p></o:p></p><p class=\"MsoNormal\" style=\"text-indent:21.0pt\"><span lang=\"ZH-CN\" style=\"font-family:宋体;mso-bidi-font-family:宋体\">我们希望我们的用户放心的使用我们的产品和服务，所以我们承诺对您的个人信息予以保密，为此我们设置了安全程序保护您的信息不会被未经授权的访问所窃取。所有的个人信息被加密储存并放置于专业防火墙的内，我们使用</span>SSL<span lang=\"ZH-CN\" style=\"font-family:宋体;mso-bidi-font-family:宋体\">加密技术对您所提供的个人信息传输通道进行保护，保证您的个人信息不会在传输途中被窃取。</span><span style=\"font-family:宋体;mso-bidi-font-family:宋体\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-indent:21.0pt\"><o:p>&nbsp;</o:p></p><p class=\"MsoNormal\">Cookies<span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:\nCalibri;mso-hansi-font-family:Calibri\">和其他浏览器技</span><span lang=\"ZH-CN\" style=\"font-family:宋体;mso-bidi-font-family:宋体\">术</span><o:p></o:p></p><p class=\"MsoNormal\" style=\"text-indent:21.0pt\"><span lang=\"ZH-CN\" style=\"font-family:宋体;mso-bidi-font-family:宋体\">当用户访问距马科技服务平台的时候，我们可能会保存用户的用户登录状态并且为用户分配一个或多个</span><span style=\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">“</span>Cookie<span style=\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">”</span><span lang=\"ZH-CN\" style=\"font-family:宋体;mso-bidi-font-family:宋体\">（一个很小的文本文件），例如：当用户访问一个需要用户登录才可以提供的信息或服务，当用户登录时，我们会把该用户的登录名和密码加密存储在用户计算机的</span>Cookie<span lang=\"ZH-CN\" style=\"font-family:宋体;mso-bidi-font-family:宋体\">文件中，由于是不可逆转的加密存储，其他人即使可以使用该用户的计算机，也无法识别出用户的用户名和密码。用户并不需要额外做任何工作，所有的收集和保存都由系统自动完成。</span><o:p></o:p></p><p class=\"MsoNormal\" style=\"text-indent:21.0pt\">Cookie<span lang=\"ZH-CN\" style=\"font-family:宋体;mso-bidi-font-family:宋体\">文件将永久的保存在您的计算机或移动设备上，除非您使用浏览器或操作系统软件手工将其删除。您也可以选择</span><span style=\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">“</span><span lang=\"ZH-CN\" style=\"font-family:宋体;mso-bidi-font-family:宋体\">不使用</span>Cookie<span style=\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">”</span><span lang=\"ZH-CN\" style=\"font-family:宋体;mso-bidi-font-family:宋体\">或</span><span style=\"font-family:\n&quot;Times New Roman&quot;,&quot;serif&quot;\">“</span><span lang=\"ZH-CN\" style=\"font-family:宋体;\nmso-bidi-font-family:宋体\">在使用</span>Cookie<span lang=\"ZH-CN\" style=\"font-family:\n宋体;mso-bidi-font-family:宋体\">是事先通知我</span><span style=\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">”</span><span lang=\"ZH-CN\" style=\"font-family:宋体;mso-bidi-font-family:宋体\">的选项禁止</span>Cookie<span lang=\"ZH-CN\" style=\"font-family:宋体;mso-bidi-font-family:宋体\">的产生，但是您将为此无法使用一些距马科技的查询和服务。</span><o:p></o:p></p><p class=\"MsoNormal\" style=\"text-indent:21.0pt\">Cookie<span lang=\"ZH-CN\" style=\"font-family:宋体;mso-bidi-font-family:宋体\">文件也可能会由距马科技的第三方广告合作伙伴放置到您的计算机上。这些公司可能会根据您访问相关网站的统计信息为您显示您可能感兴趣的产品或广告信息。这些统计信息并不包括您的个人信息。他们也可能通过这种方式来评估广告的有效度和统计匿名访问的数据，并根据统计结果显示您可能感兴趣的产品或广告信息，同样，这些统计信息并不包括您的个人信息。</span><o:p></o:p></p><p class=\"MsoNormal\"><o:p>&nbsp;</o:p></p><p class=\"MsoNormal\"><span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:\nCalibri;mso-hansi-font-family:Calibri\">合作伙</span><span lang=\"ZH-CN\" style=\"font-family:宋体;mso-bidi-font-family:宋体\">伴</span><o:p></o:p></p><p class=\"MsoNormal\" style=\"text-indent:21.0pt\"><span lang=\"ZH-CN\" style=\"font-family:宋体;mso-bidi-font-family:宋体\">我们选择有信誉的第三方公司或网站作为我们的合作伙伴为用户提供信息和服务，所有距马科技网上提供的服务都来自第三方合作伙伴，尽管我们只选择有信誉的公司或网站作为我们的合作伙伴，但是每个合作伙伴都会有与距马科技不同的隐私条款，一旦您通过点击进入了合作伙伴的网站，距马科技的隐私条款将不再生效，我们建议您查看该合作伙伴网站的隐私条款，并了解该合作伙伴对于收集、使用、泄露您的个人信息的规定。</span><o:p></o:p></p><p class=\"MsoNormal\"><o:p>&nbsp;</o:p></p><p class=\"MsoNormal\"><span lang=\"ZH-CN\" style=\"font-family:宋体;mso-ascii-font-family:\nCalibri;mso-hansi-font-family:Calibri\">关于隐私条款的变</span><span lang=\"ZH-CN\" style=\"font-family:宋体;mso-bidi-font-family:宋体\">更</span><o:p></o:p></p><p class=\"MsoNormal\" style=\"text-indent:21.0pt\"><span lang=\"ZH-CN\" style=\"font-family:宋体;mso-bidi-font-family:宋体\">距马科技将根据法律、法规或政策的变更和修改，或距马科技网站内容的变化和技术的更新，或其他距马科技认为合理的原因，对本隐私政策进修改并以网站公告、用户通知等合适的形式告知用户，若您不接受修订后的条款的，应立即停止使用本服务，若您在本隐私条款变更后继续使用本服务的，视为接受修订后的所有条款。</span><span style=\"font-family:宋体;mso-bidi-font-family:宋体\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-indent:21.0pt\"><span style=\"font-family:宋体;\nmso-bidi-font-family:宋体\">&nbsp;</span></p><p class=\"MsoNormal\" style=\"text-indent:21.0pt\"><span style=\"font-family:宋体;\nmso-bidi-font-family:宋体\">&nbsp;</span></p><p class=\"MsoNormal\" style=\"text-indent:21.0pt\"><span style=\"font-family:宋体;\nmso-bidi-font-family:宋体\">&nbsp;</span></p><p class=\"MsoNormal\" style=\"text-indent:21.0pt\"><span style=\"font-family:宋体;\nmso-bidi-font-family:宋体\">&nbsp;</span></p><p class=\"MsoNormal\" style=\"text-indent:21.0pt\"><span style=\"font-family:宋体;\nmso-bidi-font-family:宋体\">&nbsp;</span></p><p class=\"MsoNormal\" style=\"text-indent:21.0pt\"><span style=\"font-family:宋体;\nmso-bidi-font-family:宋体\">&nbsp;</span></p><p class=\"MsoNormal\" style=\"text-indent:21.0pt\"><span style=\"font-family:宋体;\nmso-bidi-font-family:宋体\">&nbsp;</span></p><p class=\"MsoNormal\" style=\"text-indent:21.0pt\"><span style=\"font-family:宋体;\nmso-bidi-font-family:宋体\">&nbsp;</span></p><p class=\"MsoNormal\" style=\"text-indent:21.0pt\"><span style=\"font-family:宋体;\nmso-bidi-font-family:宋体\">&nbsp;</span></p><p class=\"MsoNormal\" style=\"text-indent:21.0pt\"><span style=\"font-family:宋体;\nmso-bidi-font-family:宋体\">&nbsp;</span></p><p class=\"MsoNormal\" style=\"text-indent:21.0pt\"><span style=\"font-family:宋体;\nmso-bidi-font-family:宋体\">&nbsp;</span></p><p class=\"MsoNormal\" style=\"text-indent:21.0pt\"><span style=\"font-family:宋体;\nmso-bidi-font-family:宋体\">&nbsp;</span></p><p class=\"MsoNormal\" style=\"text-indent:21.0pt\"><span style=\"font-family:宋体;\nmso-bidi-font-family:宋体\">&nbsp;</span></p><p class=\"MsoNormal\" style=\"text-indent:21.0pt\"><span style=\"font-family:宋体;\nmso-bidi-font-family:宋体\">&nbsp;</span></p><p class=\"MsoNormal\" style=\"text-indent:21.0pt\"><span style=\"font-family:宋体;\n