INSERT INTO `sys_news` VALUES ('04f95ea70d98454cb68282039545b99f', '绍兴滨海新城管委会莅临智行家', 'http://res.m.vway.me/73046f28c151cdc2242575e1f4a8c672.jpg', '近日，绍兴滨海新城经济发展局局长、招商局局长等领导一行莅临距马（上海）科技有限公司，进行了实地考察，并签署了战略合作协议。', '<p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; clear: both; min-height: 1em; white-space: pre-wrap; color: rgb(62, 62, 62); font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Arial, sans-serif; line-height: 25.6px; text-align: left; box-sizing: border-box !important; word-wrap: break-word !important; background-color: rgb(255, 255, 255);\"><br/></p><p style=\"margin-top: 0px; margin-bottom: 20px; padding: 0px; max-width: 100%; clear: both; min-height: 1em; white-space: pre-wrap; color: rgb(62, 62, 62); font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Arial, sans-serif; line-height: 25.6px; box-sizing: border-box !important; word-wrap: break-word !important; background-color: rgb(255, 255, 255);\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; color: rgb(255, 169, 0); line-height: 25.6px; box-sizing: border-box !important; word-wrap: break-word !important;\">11月1日上午，绍兴滨海新城经济发展局局长曹绘宏、招商三局局长黄汉平、绍兴嘉诚汽车服务有限公司总经理张国旗等一行七人莅临智行家外高桥运营中心实地调研。</span></p><p style=\"margin-top: 0px; margin-bottom: 20px; padding: 0px; max-width: 100%; clear: both; min-height: 1em; white-space: pre-wrap; color: rgb(62, 62, 62); font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Arial, sans-serif; line-height: 25.6px; box-sizing: border-box !important; word-wrap: break-word !important; background-color: rgb(255, 255, 255);\"><img data-s=\"300,640\" data-type=\"jpeg\" src=\"https://mmbiz.qlogo.cn/mmbiz_jpg/hxqN5R55MoY7gdJ2jvklwCfP6fhq7Ss5A9XStHfHX7I6GibpvvL32XicEsMWZZS671Swhgvicbo4nticy1bkuGTcDQ/0?wx_fmt=jpeg\" data-ratio=\"0.61640625\" data-w=\"1280\" style=\"margin: 0px; padding: 0px; max-width: 100%; font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Arial, sans-serif; font-size: medium; line-height: 25.6px; text-align: center; white-space: pre-wrap; height: auto !important;\"/><span style=\"margin: 0px; padding: 0px; max-width: 100%; color: rgb(255, 169, 0); line-height: 25.6px; box-sizing: border-box !important; word-wrap: break-word !important;\"></span></p><p style=\"margin-top: 0px; margin-bottom: 10px; padding: 0px; max-width: 100%; clear: both; min-height: 1em; white-space: pre-wrap; color: rgb(62, 62, 62); font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Arial, sans-serif; line-height: 25.6px; text-align: center; box-sizing: border-box !important; word-wrap: break-word !important; background-color: rgb(255, 255, 255);\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; line-height: 25.6px; color: rgb(136, 136, 136); box-sizing: border-box !important; word-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\">图为绍兴滨海新城管委会领导一行与智行家热烈洽谈中</span></strong></p><p style=\"margin-top: 0px; margin-bottom: 15px; padding: 0px; max-width: 100%; clear: both; min-height: 1em; white-space: pre-wrap; color: rgb(62, 62, 62); font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Arial, sans-serif; line-height: 25.6px; text-align: center; box-sizing: border-box !important; word-wrap: break-word !important; background-color: rgb(255, 255, 255);\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; color: rgb(136, 136, 136); line-height: 25.6px; box-sizing: border-box !important; word-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\"><strong style=\"margin: 0px; padding: 0px; font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Arial, sans-serif; font-size: medium; line-height: 25.6px; text-align: center; white-space: pre-wrap; color: rgb(136, 136, 136);\"><span style=\"margin: 0px; padding: 0px; font-size: 14px;\"><img data-s=\"300,640\" data-type=\"jpeg\" src=\"https://mmbiz.qlogo.cn/mmbiz_jpg/hxqN5R55MoY7gdJ2jvklwCfP6fhq7Ss5qaLJ4ULsSGYKId9GJBP3ic9ToaPupeHmNFgpPxV5sOl7ZUAc4ayQicyQ/0?wx_fmt=jpeg\" data-ratio=\"0.6875\" data-w=\"1280\" style=\"margin: 0px; padding: 0px; max-width: 100%; height: auto !important;\"/></span></strong></span></strong></p><p style=\"margin-top: 0px; margin-bottom: 10px; padding: 0px; max-width: 100%; clear: both; min-height: 1em; white-space: pre-wrap; color: rgb(62, 62, 62); font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Arial, sans-serif; line-height: 25.6px; box-sizing: border-box !important; word-wrap: break-word !important; background-color: rgb(255, 255, 255);\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; color: rgb(255, 169, 0); line-height: 1.6;\">距马（上海）科技有限公司CEO陈扬详细介绍了智行家项目的产品和服务及目前项目运营情况。公司</span><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; color: rgb(255, 169, 0); line-height: 1.6;\">以园区企业出行需求为导向，铺设行车网点、优化出行路线，将新能源车及基础设施实现感知化、互联化和智能化，建设一套配置完善、节能环保、服务多元的精细化行车服务体系。</span><br style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\"/></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; clear: both; min-height: 1em; white-space: pre-wrap; color: rgb(62, 62, 62); font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Arial, sans-serif; line-height: 25.6px; box-sizing: border-box !important; word-wrap: break-word !important; background-color: rgb(255, 255, 255);\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; color: rgb(255, 169, 0);\">绍兴滨海新城经济发展局局长曹绘宏及招商局局长黄汉平等一行认真听完了介绍，给予了智行家项目极高的认可和肯定。</span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; clear: both; min-height: 1em; white-space: pre-wrap; color: rgb(62, 62, 62); font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Arial, sans-serif; line-height: 25.6px; box-sizing: border-box !important; word-wrap: break-word !important; background-color: rgb(255, 255, 255);\"><br/></p><p><br/></p><section style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; color: rgb(62, 62, 62); font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Arial, sans-serif; line-height: 25.6px; white-space: normal; word-wrap: break-word !important; background-color: rgb(255, 255, 255);\"><section class=\"\" powered-by=\"xiumi.us\" style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important;\"><section class=\"\" style=\"margin: 10px 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important;\"><section class=\"\" style=\"margin: -13px 3px; padding: 12px; max-width: 100%; box-sizing: border-box; word-wrap: break-word; border: 1px solid rgb(95, 156, 239); border-radius: 6px;\"><section class=\"\" powered-by=\"xiumi.us\" style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important;\"><section class=\"\" style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important;\"><section class=\"\" style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; font-size: 14px; text-align: justify; line-height: 2;\"><section style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; color: rgb(136, 136, 136); box-sizing: border-box !important; word-wrap: break-word !important;\">绍兴滨海新城成立于2010年7月，是浙江省构筑海洋经济发展带、推进大平台大产业大项目大企业建设的重点区域，是浙江省“十二五”重点布局的14个省级产业集聚区和重点开发区（园区）之一。新城地处</span><span style=\"margin: 0px; padding: 0px; max-width: 100%; color: rgb(136, 136, 136); box-sizing: border-box !important; word-wrap: break-word !important;\">杭州湾</span><span style=\"margin: 0px; padding: 0px; max-width: 100%; color: rgb(136, 136, 136); box-sizing: border-box !important; word-wrap: break-word !important;\">金南翼，接轨大上海的桥头堡，规划总面积近500平方公里。绍兴滨海新城江滨区域是一块充满活力、富有潜力的开发热土，拥有突出的开发比较优势。</span></section></section></section></section></section><section class=\"\" style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; height: 16px;\"><section style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; height: 15.9896px; width: 24px; float: left; border-bottom-width: 6px; border-bottom-style: solid; border-color: rgb(95, 156, 239); border-left-width: 6px; border-left-style: solid;\"></section></section></section></section></section><p><br/></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; clear: both; min-height: 1em; white-space: pre-wrap; color: rgb(62, 62, 62); font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Arial, sans-serif; line-height: 25.6px; box-sizing: border-box !important; word-wrap: break-word !important; background-color: rgb(255, 255, 255);\"><br/></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; clear: both; min-height: 1em; white-space: pre-wrap; color: rgb(62, 62, 62); font-family: &#39;He