INSERT INTO `sys_news` VALUES ('a4b3d420cb7e4ce8a33081b82d88037b', '智行家“聚焦新能源”智慧出行专题采访', 'http://res.m.vway.me/51b3df8782b33732b6e88e83fd7c1aac.jpg', '智行家董事长陈扬于9月27日下午接受东方财经·浦东电视台《聚焦自贸区》栏目关于“聚焦新能源”专题采访。', '<div class=\"rich_media_thumb_wrp\" id=\"media\" style=\"margin: 0px 0px 6px; padding: 0px; text-align: center;\"></div><div class=\"rich_media_content \" id=\"js_content\" style=\"margin: 0px; padding: 0px; overflow: hidden; color: rgb(62, 62, 62); min-height: 350px; position: relative;\"><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; clear: both; min-height: 1em; white-space: pre-wrap; text-align: justify; text-indent: 2em; box-sizing: border-box !important; word-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; line-height: 1.6; text-indent: 2em; color: rgb(255, 104, 39);\">智慧出行项目在外高桥保税区开展三个月以来，在自贸区管委会、外高桥集团及外联发的大力支持下，智行家项目<span style=\"margin: 0px; padding: 0px; max-width: 100%; line-height: 25.6px; color: rgb(255, 76, 0); box-sizing: border-box !important; word-wrap: break-word !important; background-color: rgb(255, 255, 255);\">进展顺利，市场不断拓展，</span>新能源汽车在园区道路上随处可见。9月27日下午，东方财经<strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\">·</strong>浦东电视台《聚焦自贸区》栏目组对智行家进行专题采访。</span><br style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\"/></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; clear: both; min-height: 1em; white-space: pre-wrap; box-sizing: border-box !important; word-wrap: break-word !important;\"><br style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\"/></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; clear: both; min-height: 1em; white-space: pre-wrap; text-align: center; box-sizing: border-box !important; word-wrap: break-word !important;\"><img data-s=\"300,640\" data-type=\"jpeg\" data-src=\"http://mmbiz.qpic.cn/mmbiz_jpg/hxqN5R55MoYl2sF6F4qyIBjOzF0CvY7Qjp7M77AlGltoTmRFRicA0r2h6uAgxzfvhrLaMqVHJgLE3JXp7TYZZRg/0?wx_fmt=jpeg\" data-ratio=\"0.75\" data-w=\"1280\" src=\"http://mmbiz.qpic.cn/mmbiz_jpg/hxqN5R55MoYl2sF6F4qyIBjOzF0CvY7Qjp7M77AlGltoTmRFRicA0r2h6uAgxzfvhrLaMqVHJgLE3JXp7TYZZRg/640?wx_fmt=jpeg&tp=webp&wxfrom=5&wx_lazy=1\" data-fail=\"0\" style=\"margin: 0px; padding: 0px; height: auto !important; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; width: auto !important; visibility: visible !important;\"/><br style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\"/><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; color: rgb(136, 136, 136); text-indent: 2em; line-height: 1.6;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\">距马（上海）科技有限公司外景</span></strong></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; clear: both; min-height: 1em; white-space: pre-wrap; text-indent: 2em; box-sizing: border-box !important; word-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; color: rgb(136, 136, 136);\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;\"><br style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\"/></span></strong></span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; clear: both; min-height: 1em; white-space: pre-wrap; text-indent: 2em; text-align: justify; box-sizing: border-box !important; word-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; color: rgb(255, 104, 39);\">智慧出行项目以自贸区企业出行需求为导向，响应国家新能源汽车产业政策，促进分享经济发展，提高资源利用效率，与外高桥园区进行有效连接，充分整合新能源汽车，园区车位和充电设施，优化园区最后一公里的出行问题。</span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; clear: both; min-height: 1em; white-space: pre-wrap; text-indent: 2em; box-sizing: border-box !important; word-wrap: break-word !important;\"><br style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\"/></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; clear: both; min-height: 1em; white-space: pre-wrap; text-align: center; box-sizing: border-box !important; word-wrap: break-word !important;\"><img data-s=\"300,640\" data-type=\"jpeg\" data-src=\"http://mmbiz.qpic.cn/mmbiz_jpg/hxqN5R55Moa5icp6cBE2dTmGwXiba21x7fPiajk6fa6ReP5yZPIx2gOvZ4lbndkU0HwrHbMSHaMmfD8d6CfJLiclmg/0?wx_fmt=jpeg\" data-ratio=\"1.24921875\" data-w=\"1280\" src=\"http://mmbiz.qpic.cn/mmbiz_jpg/hxqN5R55Moa5icp6cBE2dTmGwXiba21x7fPiajk6fa6ReP5yZPIx2gOvZ4lbndkU0HwrHbMSHaMmfD8d6CfJLiclmg/640?wx_fmt=jpeg&tp=webp&wxfrom=5&wx_lazy=1\" data-fail=\"0\" style=\"margin: 0px; padding: 0px; height: auto !important; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; width: auto !important; visibility: visible !important;\"/><br style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\"/></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; clear: both; min-height: 1em; white-space: pre-wrap; text-align: center; box-sizing: border-box !important; word-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; color: rgb(136, 136, 136); font-size: 14px;\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\">距马（上海）科技有限公司董事长兼CEO</strong>—<strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\">陈扬</strong></span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; clear: both; min-height: 1em; white-space: pre-wrap; text-indent: 2em; box-sizing: border-box !important; word-wrap: break-word !important;\"><br style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\"/></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; clear: both; min-height: 1em; white-space: pre-wrap; text-indent: 2em; text-align: justify; box-sizing: border-box !important; word-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; color: rgb(255, 104, 39);\">董事长陈扬先生表示：智行家是个三方平台，从园区整体规划出发，为园区引进多家充电桩，分时租赁公司提供出行服务，目前我们已与宁波、天津、苏州等园区达成意向合作，在提供企业班车、分时租赁汽车的同时也解决了新能源电动汽车充电问题，整合园区出行，从而达到节能减排环境保护的目的。</span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; clear: both; min-height: 1em; white-space: pre-wrap; box-sizing: border-box !important; word-wrap: break-word !important;\"><br style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\"/></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; clear: both; min-height: 1em; white-space: pre-wrap; box-sizing: border-box !important; word-wrap: break-word !important;\"><br style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\"/></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; clear: both; min-height: 1em; white-space: pre-wrap; box-sizing: border-box !important; word-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; color: rgb(255, 104, 39);\">此次专访智行家邀请了合作伙伴一起参与：</span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; clear: both; min-height: 1em; white-space: pre-wrap; box-sizing: border-box !important; word-wrap: break-word !important;\"><br style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\"/></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; clear: both; min-height: 1em; white-space: pre-wrap; box-sizing: border-box !important; word-wrap: break-word !important; text-align: center;\"><img data-s=\"300,640\" data-type=\"jpeg\" data-src=\"http://mmbiz.qpic.cn/mmbiz_jpg/hxqN5R55MoYl2sF6F4qyIBjOzF0CvY7QHYAjQkNL4sfficVQkxpdgFFjfTploOcW69Pb9nNSicjIria7prynhFia1Q/0?wx_fmt=jpeg\" data-ratio=\"0.4171974522292994\" data-w=\"942\" src=\"http://mmbiz.qpic.cn/mmbiz_jpg/hxqN5R55MoYl2sF6F4qyIBjOzF0CvY7QHYAjQkNL4sfficVQkxpdgFFjfTploOcW69Pb9nNSicjIria7prynhFia1Q/640?wx_fmt=jpeg&tp=webp&wxfrom=5&wx_lazy=1\" data-fail=\"0\" style=\"margin: 0px; padding: 0px; height: auto !important; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; width: auto !important; visibility: visible !important;\"/><br style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\"/></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; clear: both; min-height: 1em; white-space: pre-wrap; text-indent: 2em; box-sizing: border-box !important; word-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; color: rgb(0, 0, 0);\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; text-align: center; font-family: arial, 宋体, sans-serif; line-height: 24px; text-indent: 28px; box-sizing: border-box !important; word-wrap: break-word !important; background-color: rgb(255, 255, 255);\"></span></strong></span></p><ul class=\" list-paddingleft-2\" style=\"list-style-type: square;\"><li><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; clear: both; min-height: 1em; white-space: pre-wrap; text-indent: 0em; box-sizing: border-box !important; word-wrap: break-word !important;\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; color: rgb(136, 136, 136); box-sizing: border-box !important; word-wrap: break-word !important;\">上海神舟电力有限公司</span></strong><span style=\"margin: 0px; padding: 0px; max-width: 100%; color: rgb(136, 136, 136); box-sizing: border-box !important; word-wrap: break-word !important;\">，隶属于中国航天科技集团公司第八研究院，是国内主流的光伏电站系统集成商。此次作为智行家平台下光伏产业合作伙伴代表参加访谈。外高桥光伏站试点就在智行家企业门口，以自充自储自用的模式运营。上海神舟电力有限公司总经理司德亮表示，未来跟智行家的合作还会涉及到商务楼、居民楼屋顶光伏发电等，以高效的太阳能利用率满足居民，企业办公等需求。</span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; clear: both; min-height: 1em; white-space: pre-wrap; box-sizing: border-box !important; word-wrap: break-word !important;\"><br style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\"/></p></li><li><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; clear: both; min-height: 1em; white-space: pre-wrap; text-indent: 0em; box-sizing: border-box !important; word-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; color: rgb(136, 136, 136);\">上海特来电新能源有限公司</span></strong><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; color: rgb(136, 136, 136);\">，是一家专门从事充电桩生产制造运营的企业，以其特有的无桩充电方式、智能充电模块及群控群管模式，领跑充电桩行业。此次作为智行家平台下充电桩供应商合作伙伴代表参加访谈。特来电新能源有限公司副总经理就特来电的直流/交流充电桩产品，充电桩未来的发展趋势及电池的续航能力研发等方面做了详细的解答。充分肯定了智行家的运营模式，就智行家模式的全国复制达成了深度合作。</span></span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; clear: both; min-height: 1em; white-space: pre-wrap; text-indent: 2em; box-sizing: border-box !important; word-wrap: break-word !important;\"><br style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\"/></p></li><li><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; clear: both; min-height: 1em; white-space: pre-wrap; text-indent: 0em; box-sizing: border-box !important; word-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; color: rgb(136, 136, 136);\">“GoFun出行”是</span><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; color: rgb(136, 136, 136);\">北京首汽智行科技有限公司（简称“<strong style=\"margin: 0px; padding: 0px; max-width: 100%; line-height: 25.6px; box-sizing: border-box !important; word-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\">首汽智行</span></strong>”）</span></strong><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; color: rgb(136, 136, 136);\">开展的新能源分时租车项目，成立于2015年，是首汽集团控股公司，总部位于北京。致力于为用户提供便捷、绿色、快速、经济、时尚的城市公共交通出行服务解决方案。此次作为智行家平台下分时租赁合作伙伴代表参加访谈。“GoFun出行”在北京已经成功运营，智行家作为上海首家引进“GoFun出行”的企业，改变租车行业的传统模式。首汽智行上海分公司总经理陆晓栋就“GoFun出行”的操作方式及收费方式做了解答。分时车辆无人值守，全程APP操作，目前以“0.1元/分钟+1元/公里”的计费方式提供汽车的随取即用租赁服务，上海市日平准使用次数为1.4次/车。</span></span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; clear: both; min-height: 1em; white-space: pre-wrap; text-indent: 2em; box-sizing: border-box !important; word-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 18px;\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px; color: rgb(136, 136, 136);\">&nbsp;</span></strong></span></p></li><li><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; clear: both; min-height: 1em; white-space: pre-wrap; text-indent: 0em; box-sizing: border-box !important; word-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; color: rgb(136, 136, 136);\">上海峻海汽车租赁有限公司</span></strong><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; color: rgb(136, 136, 136);\">，是一家致力于互联网网约车平台以及汽车租赁与外派的全方位发展企业。公司合作驾驶员3万左右，目前是滴滴出行高端商务车最大的供应商。峻海租车此次作为智行家平台下网约车合作伙伴代表参加访谈，峻海租车总经理王海，就新能源车在滴滴出行使用上有关续航，收费等问题做了解答。目前就200辆新能源汽车运营调度中心项目与智行家达成战略合作，智行家会在外高桥进行选址，并将充电桩等基础设施安装完成，引进峻海租车品牌。</span></span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; clear: both; min-height: 1em; white-space: pre-wrap; text-indent: 2em; box-sizing: border-box !important; word-wrap: break-word !important;\"><br style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\"/></p></li><li><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; clear: both; min-height: 1em; white-space: pre-wrap; text-indent: 0em; box-sizing: border-box !important; word-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; color: rgb(136, 136, 136);\">上海绿雅新能源汽车服务有限公司</span></strong><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; color: rgb(136, 136, 136);\">，主要从事新能源纯电动大客车的销售、租赁、客运等业务。绿雅新能源此次作为新能源大巴供应商的代表参加访谈，公司总经理王铁峰就新能源纯电大巴与传统燃油大巴在业务范围、模式上的一些区别做了解答，并将集团下的纯电物流车、环卫车和特种车辆引进智行家平台。未来的合作还会涉及到充电站建设和电池回收等业务。</span></span></p></l