INSERT INTO `sys_news` VALUES ('bb0cb6ec04dc4b1cbc772f5f26f1345c', '智行家与北斗交大新能源签订《智慧出行项目》合作协议', 'http://res.m.vway.me/b3aff240bf2c797ab42291a36366e0ed.jpg', '9月13日，距马（上海）科技有限公司与上海北斗交大新能源汽车服务有限公司签署战略合作协议', '<p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; clear: both; min-height: 1em; white-space: normal; font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Arial, sans-serif; text-indent: 0em; color: rgb(102, 102, 101); line-height: 30px; box-sizing: border-box !important; word-wrap: break-word !important; text-align: center; background-color: rgb(255, 255, 255);\"><br/></p><p class=\"\" style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; clear: both; min-height: 1em; white-space: normal; font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Arial, sans-serif; color: rgb(102, 102, 101); line-height: 30px; text-indent: 2em; box-sizing: border-box !important; word-wrap: break-word !important; background-color: rgb(255, 255, 255);\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-family: 宋体, SimSun; line-height: 25.6px; white-space: pre-wrap; color: rgb(255, 104, 39);\">9月13日，距马（上海）科技有限公司与上海北斗交大新能源汽车服务有限公司签署战略合作协议，正式成为外高桥保税区“智慧出行”项目平台智行家合作伙伴，“格灵”新能源车将如一匹骏马般飞驰在外高桥保税区。</span></p><p class=\"\" style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; clear: both; min-height: 1em; white-space: normal; font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Arial, sans-serif; color: rgb(102, 102, 101); line-height: 30px; text-indent: 2em; box-sizing: border-box !important; word-wrap: break-word !important; background-color: rgb(255, 255, 255);\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; font-family: 宋体, SimSun; line-height: 25.6px; white-space: pre-wrap; co