box-sizing: border-box !important; word-wrap: break-word !important; background-color: rgb(255, 255, 255);\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; white-space: pre-wrap; line-height: 1.6; text-indent: 2em; font-family: 宋体, SimSun; color: rgb(64, 118, 0);\"><br style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\"/></span></p><p class=\"\" style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; clear: both; min-height: 1em; white-space: normal; font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Arial, sans-serif; color: rgb(102, 102, 101); line-height: 30px; text-indent: 2em; box-sizing: border-box !important; word-wrap: break-word !important; background-color: rgb(255, 255, 255);\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; white-space: pre-wrap; line-height: 1.6; text-indent: 2em; font-family: 宋体, SimSun; color: rgb(255, 104, 39);\">上海北斗交大新能源汽车服务有限公司联合全球领先的上海北斗卫星导航和国际知名大学---上海交通大学，倡导新能源汽车共享理念，缓解城市交通拥堵，减少空气污染，保护环境，并最终实现城市可持续发展。</span></p><p class=\"\" style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; clear: both; min-height: 1em; white-space: normal; font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Arial, sans-serif; color: rgb(102, 102, 101); line-height: 30px; text-indent: 2em; box-sizing: border-box !important; word-wrap: break-word !important; background-color: rgb(255, 255, 255);\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; white-space: pre-wrap; line-height: 1.6; text-indent: 2em; font-family: 宋体, SimSun; color: rgb(64, 118, 0);\"><br style=\"margin: 0px; padding: 0px; max-width: 100%; b