INSERT INTO `sys_news` VALUES ('ead37df3f51b45d39aafc81900383c2f', '智行家与小龙巴士签订《智慧出行项目》协议', 'http://res.m.vway.me/a1a1fe38f8473ce0402bced48a00e93e.jpg', '9月8日，距马（上海）科技有限公司与上海帛孚信息技术有限公司签订智慧出行项目合作协议，小龙巴士正式成为智行家合作伙伴', '<p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; clear: both; white-space: pre-wrap; font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Arial, sans-serif; text-indent: 0em; max-width: 100%; min-height: 1em; line-height: 1.75em; text-align: center; box-sizing: border-box !important; word-wrap: break-word !important;\"><img data-s=\"300,640\" data-type=\"jpeg\" data-ratio=\"0.75\" data-w=\"640\" src=\"https://mmbiz.qlogo.cn/mmbiz_jpg/hxqN5R55MobichcwLiaU6M2ibpLyK2a2Ror74SkVYzTDvYeBiboj6FuPAZUawTuD902TNnDwCicbyMwtyOQ0OnImufw/640?wx_fmt=jpeg\" style=\"margin: 0px; padding: 0px; max-width: 100%; height: auto !important; box-sizing: border-box !important; word-wrap: break-word !important; width: auto !important; visibility: visible !important;\"/><br style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\"/></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; clear: both; white-space: pre-wrap; font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Arial, sans-serif; max-width: 100%; min-height: 1em; line-height: 1.75em; text-indent: 2em; box-sizing: border-box !important; word-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; color: rgb(255, 172, 170); box-sizing: border-box !important; word-wrap: break-word !important;\"><br style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\"/></span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; clear: both; white-space: pre-wrap; font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Arial, sans-serif; max-width: 100%; min-height: 1em; line-height: 1.75em; text-indent: 2em; box-sizing: border-box !important; word-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; color: rgb(255, 172, 170); box-sizing: border-box !important; word-wrap: break-word !important;\">9月8日，距马（上海）科技有限公司与上海帛孚信息技术有限公司签订智慧出行项目合作协议，小龙巴士正式成为智行家项目合作伙伴，入驻外高桥保税区智慧出行项目。</span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; clear: both; white-space: pre-wrap; font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Arial, sans-serif; max-width: 100%; min-height: 1em; line-height: 1.75em; text-indent: 2em; box-sizing: border-box !important; word-wrap: break-word !important;\"><br style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\"/></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; clear: both; white-space: pre-wrap; font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Arial, sans-serif; text-indent: 0em; max-width: 100%; min-height: 1em; line-height: 1.75em; text-align: center; box-sizing: border-box !important; word-wrap: break-word !important;\"><img data-s=\"300,640\" data-type=\"jpeg\" data-ratio=\"1.4221311475409837\" data-w=\"488\" src=\"https://mmbiz.qlogo.cn/mmbiz_jpg/hxqN5R55MobichcwLiaU6M2ibpLyK2a2RorKicibQia76aUN2hSjkkCn1yCSWvyelAkkWwNMbwNn2xiclCRVJgoyicJsvA/640?wx_fmt=jpeg\" style=\"margin: 0px; padding: 0px; max-width: 100%; height: auto !important; box-sizing: border-box !important; word-wrap: break-word !important; width: auto !important; visibility: visible !important;\"/><br style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\"/></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; clear: both; white-space: pre-wrap; font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Arial, sans-serif; line-height: 25.6px; max-width: 100%; min-height: 1em; text-indent: 2em; text-align: center; box-sizing: border-box !important; word-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; color: rgb(255, 76, 0); font-family: &#39;microsoft yahei&#39;; box-sizing: border-box !important; word-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; font-size: 15px; line-height: 21.4286px; color: rgb(0, 0, 0); box-sizing: border-box !important; word-wrap: break-word !important; background-color: rgb(255, 255, 255);\">智行家COO金涛先生与小龙巴士CEO熊光辉先生</span></span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; clear: both; white-space: pre-wrap; font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Arial, sans-serif; line-height: 25.6px; max-width: 100%; min-height: 1em; text-indent: 2em; text-align: center; box-sizing: border-box !important; word-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; color: rgb(255, 76, 0); font-family: &#39;microsoft yahei&#39;; box-sizing: border-box !important; word-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; font-size: 15px; line-height: 21.4286px; color: rgb(0, 0, 0); box-sizing: border-box !important; word-wrap: break-word !important; background-color: rgb(255, 255, 255);\"><br style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\"/></span></span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; clear: both; white-space: pre-wrap; font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Arial, sans-serif; max-width: 100%; min-height: 1em; line-height: 1.75em; text-indent: 2em; box-sizing: border-box !important; word-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; font-family: &#39;microsoft yahei&#39;; font-size: 15px; line-height: 21.4286px; color: rgb(255, 76, 0); box-sizing: border-box !important; word-wrap: break-word !important; background-color: rgb(255, 255, 255);\">小龙巴士立足于“互联网+”概念，将互联网作为基础设施并与传统出行方式相结合，推行智慧城市，倡导智慧交通，致力于为解决上下班交通不便、企业班车效率低下的问题，也为缓解上海上下班交通拥堵，倡导绿色出行。</span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; clear: both; white-space: pre-wrap; font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Arial, sans-serif; max-width: 100%; min-height: 1em; line-height: 1.75em; text-indent: 2em; box-sizing: border-box !important; word-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; color: rgb(102, 102, 102); font-family: &#39;microsoft yahei&#39;; font-size: 15px; line-height: 21.4286px; box-sizing: border-box !important; word-wrap: break-word !important; background-color: rgb(255, 255, 255);\"><br style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\"/></span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; clear: both; white-space: pre-wrap; font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Arial, sans-serif; text-indent: 0em; max-width: 100%; min-height: 1em; line-height: 1.75em; text-align: center; box-sizing: border-box !important; word-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; color: rgb(102, 102, 102); font-family: &#39;microsoft yahei&#39;; font-size: 15px; line-height: 21.4286px; box-sizing: border-box !important; word-wrap: break-word !important; background-color: rgb(255, 255, 255);\"><img data-s=\"300,640\" data-type=\"jpeg\" data-ratio=\"0.5779411764705882\" data-w=\"680\" src=\"https://mmbiz.qlogo.cn/mmbiz_jpg/hxqN5R55MobichcwLiaU6M2ibpLyK2a2RoruicialGkpPz8ZTKrJlrqJnXHNxgm3rbV9zZf3XdPppHEuX0a3SatLiciag/0?\" style=\"margin: 0px; padding: 0px; max-width: 100%; height: 387.221px !important; box-sizing: border-box !important; word-wrap: break-word !important; width: 670px !important;\"/><br style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\"/></span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; clear: both; white-space: pre-wrap; font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Arial, sans-serif; max-width: 100%; min-height: 1em; line-height: 1.75em; text-indent: 2em; box-sizing: border-box !important; word-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; font-family: &#39;microsoft yahei&#39;; line-height: 21.4286px; color: rgb(171, 25, 66); box-sizing: border-box !important; word-wrap: break-word !important; background-color: rgb(255, 255, 255);\"><br style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\"/></span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; clear: both; white-space: pre-wrap; font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Arial, sans-serif; max-width: 100%; min-height: 1em; line-height: 1.75em; text-indent: 2em; box-sizing: border-box !important; word-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; font-family: &#39;microsoft yahei&#39;; line-height: 21.4286px; color: rgb(171, 25, 66); box-sizing: border-box !important; word-wrap: break-word !important; background-color: rgb(255, 255, 255);\">此次强强联手，源于小龙巴士与智行家有着共同努力方向——打造绿色出行项目。双方合作涉及新能源车租赁，企业班车及包车服务，充电桩铺设等多领域，为园区提供更便捷，更环保，更舒适的出行方式。相信此次合作，必将大杀四方，实现互利共赢。</span></p><p><br/></p><p>		&nbsp; 	 &nbsp;					</p>', '距马科技', '1', '0', '2016-09-28 13:18:00', '2016-09-28 13:18:43');
